import React from 'react'
import './RecommendedVideo.css'
function RecommendedVideo() {
    return (
        <div className="recommendedVideo">
            <h2>Recommeded</h2>
            <div className="recommendedVideo__video">
                <VideoCard />
            </div>
        </div>
    )
}

export default RecommendedVideo
